     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "rec <- recipe(personality ~ ., data = data_train) %>%\n",
    "  step_zv(all_predictors()) %>%               # drop zero-variance columns\n",
    "  step_unknown(all_nominal_predictors()) %>%  # new level handling\n",
    "  step_impute_median(all_numeric_predictors()) %>%   # numeric missings\n",
    "  step_impute_mode(all_nominal_predictors()) %>%     # categorical missings\n",
    "  step_dummy(all_nominal_predictors()) %>%    # one-hot encode\n",
    "  step_normalize(all_numeric_predictors())     # scale\n"
   ]
  },
