   "source": [
    "xgb_spec <- boost_tree(\n",
    "  trees = tune(),\n",
    "  tree_depth = tune(),\n",
    "  learn_rate = tune(),\n",
    "  loss_reduction = tune(),      # gamma\n",
    "  sample_size = tune(),\n",
    "  mtry = tune()\n",
    ") %>%\n",
    "  set_engine(\"xgboost\") %>%\n",
    "  set_mode(\"classification\")\n"
   ]
